	/**
	 * 將所傳入不固定個數的字串參數用StringBuffer串成字串後回傳
	 * @author neil
	 * @param values
	 * @return
	 */
	public static String join(Object... values) {
		StringBuffer buf = new StringBuffer();
		for (Object value : values) {
			buf.append(value);
		}
		return buf.toString();
	}

	public static String rightTrim(String source) throws Exception{
        if(StringUtil.isSpace(source))
            return source;
        if(source.trim().length()==0)
            return "";
        int index=0;
        for(int i=source.length()-1;i>=0;i--){
            if(Character.isWhitespace(source.charAt(i))){
                index=i;
            }else{
                break;
            }
        }
        return index!=0 ? source.substring(0,index): source;
    }
   
    public static String leftTrim(String source) throws Exception{
    	if(StringUtil.isSpace(source))
            return source;
        if(source.trim().length()==0)
            return "";
        int index=0;
        for(int i=0;i<source.length();i++){
            if(Character.isWhitespace(source.charAt(i))){
                index=i+1;
            }else{
                break;
            }
        }
        return index!=0 ? source.substring(index): source;
    }

	/**
	 * 依分隔符號取得不重覆的大寫String[]
	 *
	 * @param str
	 *            欲分隔的字串
	 * @param separatorchar
	 *            分隔符號
	 * @return  an array of parsed Strings, null if null or empty String inputs
	 * @author EmilyChen 2008/8/27
	 */
	public static String[] distinctSplitToUpperCase(String str, String separatorchar) {
		if (str == null || str.trim().length() == 0) {
			return null;
		}
		String[] splitStrs = StringUtils.split(str, separatorchar);
		Set<String> strSet = new HashSet<String>();
		for (String splitStr : splitStrs) {
			strSet.add(StringUtils.upperCase(splitStr));
		}
		return (String[]) strSet.toArray(new String[strSet.size()]);
	}
	
	public static List<String> splitList(String str, String key){
		if (str == null || str.trim().length() == 0) {
			return null;
		}
		String[] splitStrs = StringUtils.split(str, key);
		Set<String> strSet = new HashSet<String>();
		for(String splitStr : splitStrs) {
			strSet.add(splitStr);
		}
		return new ArrayList(strSet);
	}
	
	/**
	 * 調整字串，若輸入null則傳回""
	 * 
	 * @param str
	 * @return String
	 */
	public static String nullToSpace(String str) throws Exception {
		try {
			if (str == null || str.equals("null")) {
				str = "";
			}
		} catch (Exception e) {
			System.out.println("StringUtil:nullToSpace:error");
			throw e;
		}
		return str.trim();
	}
