	/**
	 * 將serial補足至位數為length
	 * @param serial     原始字串
	 * @param appendWord 補的字串
	 * @param length     補齊的長度
	 * @param appendLeft 補的位置 => true:補在左邊(00AAAA) false:補在右邊(AAAA00) 
	 * @return
	 * @throws Exception
	 */
	public static String adjustNumber(String serial, String appendWord, int length, boolean appendLeft) throws Exception {
		String res = "";
		try {
			for (int i = 0; i < (length - String.valueOf(serial).length()); i++) {
				res += appendWord;
			}
			if(appendLeft) {
				res += serial;
			}else {
				res = serial+res;
			}
		} catch (Exception e) {
			System.out.println("StringUtil:adjustNumber:error");
			throw e;
		}
		return res;
	}
	/**
	 * 
	 * 字串結合
	 * 例如傳入 target = "A" str = "B" symbol = ","，則回傳  A,B
	 * 
	 * @param target
	 * @param str
	 * @param symbol
	 * @return
	 * @throws Exception 
	 */
	public static String appendStr(String target, String str, String symbol) throws Exception {
		target = StringUtil.nullToSpace(target);
		if("".equals(str)){
			return target;
		}
		
		if ("".equals(target)) {
			target = str;
		} else {
			target = target + symbol + str;
		}
		return target;
	}
