	/**
	 * 轉成全形字
	 * @param str
	 * @return
	 */
	public static String transChar(String str) {
		String transStr = "";
		char[] chars = str.toCharArray();
		int tranTemp = 0;
		for(int i = 0; i < chars.length; i++){ 
 
			if(chars[i] > '\200' ) { //超過為中文字
				tranTemp = (int)chars[i];
				transStr += (char)tranTemp;
				continue;
			}else if (chars[i] == 32 ) { //半型空白轉成全型空白
				chars[i] = (char)12288; 
				tranTemp = (int)chars[i];
				transStr += (char)tranTemp;
				continue;				
			}else if( Character.isLetterOrDigit(chars[i]))	//有定義的字、數字及符號
			{ 
				chars[i] = (char)(chars[i]+65248); //此數字是 Unicode編碼轉為十進位 和 ASCII碼的 差
				tranTemp = (int)chars[i];
				transStr += (char)tranTemp;
			}
		}
		return transStr;
	}
	
