	/**
	* 去除字元串中頭部和尾部所包含的空格(包括:空格(全形，半形)、製表符、換頁符等)
	* @param s
	* @return
	*/
	public static String trim(String s){
		String result = "";
        if(null!=s && !"".equals(s)){
            result = s.replaceAll("^[　*| *| *|//s*]*", "").replaceAll("[　*| *| *|//s*]*$", "");
        }
        return result;
	}
	
